export function moduleData(){return{props:{returnData:Function,value:[String,Number],placeHolder:String},data:function(){return{option:this.value}},watch:{option:{handler(t,e){this.returnData(this.option)},deep:!0}},template:'<div class="uip-flex">      <input  type="number" class="uip-input-small" v-model="option" :placeholder="placeHolder">    </div>'}};